-- Create the database
DROP DATABASE IF EXISTS StockAuction;
CREATE DATABASE StockAuction;
USE StockAuction;

-- The tables and some data
-- AuctionDay
DROP TABLE IF EXISTS AuctionDay;
CREATE TABLE AuctionDay(
	id smallint NOT NULL,
	auctionDay date NOT NULL,
    PRIMARY KEY (id)
 );

INSERT AuctionDay (id, auctionDay) VALUES (1619, '2020-08-03');
INSERT AuctionDay (id, auctionDay) VALUES (1620, '2019-08-10');


-- CattleAuction
DROP TABLE IF EXISTS CattleAuction;
CREATE TABLE CattleAuction(
	id nchar(5) NOT NULL,
	auctionId smallint NULL,
	startTime time NOT NULL,
	PRIMARY KEY (id)
);

INSERT CattleAuction (id, auctionId, startTime) VALUES ('C1619', 1619, '11:00');
INSERT CattleAuction (id, auctionId, startTime) VALUES ('C1620', 1620, '11:00');

ALTER TABLE CattleAuction  ADD CONSTRAINT FK_CattleAuction_AuctionDay FOREIGN KEY(auctionId)
REFERENCES AuctionDay(id);


-- SheepAuction
DROP TABLE IF EXISTS SheepAuction;
CREATE TABLE SheepAuction(
	id nchar(5) NOT NULL,
	auctionId smallint NULL,
	startTime time NOT NULL,
	PRIMARY KEY (id)
);

INSERT SheepAuction (id, auctionId, startTime) VALUES ('S1620', 1620, '11:30');

ALTER TABLE SheepAuction  ADD CONSTRAINT FK_SheepAuction_AuctionDay FOREIGN KEY(auctionId)
REFERENCES AuctionDay(id);


-- Potential Sellers and Buyers
DROP TABLE IF EXISTS AuctionClient;
CREATE TABLE AuctionClient(
	id nchar(10) NOT NULL,
	fullName nchar(50) NOT NULL,
	address1 nchar(30) NULL,
	address2 nchar(30) NULL,
	address3 nchar(30) NULL,
	province nchar(30) NULL,
	contactPerson nchar(50) NULL,
	phone nchar(15) NULL,
	phone2 nchar(15) NULL,
	email nchar(50) NULL,
	preferredNumber smallint NULL,
	PRIMARY KEY (id)
);
