-- Sheep Lot
DROP TABLE IF EXISTS SheepLot;
CREATE TABLE SheepLot(
	auctionId nchar(5) NOT NULL,
	lotNumber smallint NOT NULL,
	auctionDay smallint NOT NULL,
	seller smallint NOT NULL,
	agent nchar(10) NOT NULL,
	breed nchar(20) NOT NULL,
	sex nchar(1) NOT NULL,
	age tinyint NOT NULL,
	quantity tinyint NOT NULL,
	reserve decimal(5,2) NULL,
	auctioneer nchar(10) NULL,
	buyer smallint NULL,
	sellingPricePerHead decimal(5,2) NULL,
	lotSellingPrice decimal(7,2) AS (quantity*sellingPricePerHead),
	passedIn bit NULL,
    PRIMARY KEY(auctionId, lotNumber)
);

